import React from "react";
import "./navbar.scss";

function Navbar() {
  return (
    <div className="container">
      <div className="logo">
        <img
          src="https://assets.stickpng.com/images/620389b38c4085000441912c.png"
          alt="logo"
        />
      </div>
      <div className="nav-links">
        <span>My Leave</span>
        <div className="user">
          <span>John Doe</span>
          <img
            src="https://www.citypng.com/public/uploads/small/11640168385jtmh7kpmvna5ddyynoxsjy5leb1nmpvqooaavkrjmt9zs7vtvuqi4lcwofkzsaejalxn7ggpim4hkg0wbwtzsrp1ldijzbdbsj5z.png"
            alt="user"
          />
        </div>
      </div>
    </div>
  );
}

export default Navbar;
